import { StatusBar } from 'expo-status-bar';
import React, { useState, useEffect } from 'react';
import { StyleSheet, Text, View, TouchableWithoutFeedback,TextInput,KeyboardAvoidingView,TouchableOpacity,AsyncStorage } from 'react-native';

export default class Login extends React.Component{

    render(){
        const [email, setEmail] = useState('');
        const [password, setPassword] = useState('');

        const login = () => {
            alert('test');
        }
        return (
            <KeyboardAvoidingView behavior='padding' style={styles.wrapper}>
                <View style={styles.container}>
                    <Text>Email</Text>
                    <TextInput placeholder={'Email'} onChange={(e) => {
                        setEmail(e.target.value);
                    }}/>
                    <Text>Password</Text>
                    <TextInput secureTextEntry={true} placeholder={'Password'} onChange={(e) => {
                        setEmail(e.target.value);
                    }}/>
                    <TouchableOpacity onPress={login}>
                        <Text>Log in</Text>
                    </TouchableOpacity>
                </View>
            </KeyboardAvoidingView>
        );
    }


}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
});
